import styled from "styled-components"

const AccountPage = styled.div`
    color:#448487;
    width:80vw;
    margin:0 auto;
    height:100vw;
    text-align:center;
    padding:150px 0 20px 0;
    .subheading{
        margin:30px 0;
        padding-bottom:5px;
        display:flex;
        align-items:flex-end;
        justify-content:space-between;
        border-bottom:2px solid #214142;
        .account-info{
            font-size:1.4em;
            font-weight:bolder;
        }
    }
`

export default AccountPage
